import React, { useState } from "react";
import { useForm } from "react-hook-form";

const F = () => {
  const { register, handleSubmit, formState : { errors } } = useForm()
  const [userInfo, setUserinfo] = useState()
  const Register = (data) => {
    setUserinfo(data);
    console.log(data);
  }
  console.log(errors)
  return (
    <div>
    <div>{ JSON.stringify(userInfo,undefined, 2)}</div>
      <form>
        <div>
          <label>firstname:</label>
          <input type="firstname" name="firstname" placeholder="firstname" {...register("firstname",{required:"firstname is required"})}></input>
        </div>
        <div>
          <label>lastname:</label>
          <input type="lastname" name="lastname" placeholder="lastname" {...register("lastname", {required:"lastname is required"})}></input>
        </div>
        <div>
          <label>email:</label>
          <input type="email" name="email" placeholder="email" {...register("email", {required:"email is required"})}></input>
        </div>
        <div>
          <label>password:</label>
          <input type="password" name="password" placeholder="password" {...register("password", {required:"password is required"})}></input>
        </div>
        <button type="button" onClick={handleSubmit(Register)}>Register</button>
      </form>
    </div>
  )
}
export default F;
